import React from "react";
import {Switch, RouterBrowser, Redirect, BrowserRouter, Router} from 'react-router-dom'

function App() {
    return(
        <BrowserRouter>
        <Switch>
            <Router exact path="/"/>
            <Redirect from="*" to="/"/>
        </Switch>
        </BrowserRouter>
    )
}

export default App;
